import React from "react";
import Left1 from '../components/propsLeft';
import Right1 from '../components/propsRight';


function Props(props) {
    return (
        <div className='grid'>
            <Left1 number={props.number} />
            <Right1 
                onIncrease = {() => {
                    props.onIncrease();
                }}
            />
        </div>
    )
}

export default Props;
